import { Container, Image, Row, Col } from "react-bootstrap";
import Header from "../../components/Header";
import "./styles.css";

export default function HomeScreen() {
  return (
    <>
      <Header />
      <Container
        className="d-flex align-items-center justify-content-center flex-column"
        style={{ minHeight: "20vh" }}
      >
        <Row
          style={{ minHeight: "20vh", width: "100%" }}
          className="mt-4 d-flex flex-row justify-content-between"
        >
          <Col
            className="d-flex align-items-center justify-content-center cards-flowers"
            style={{
              backgroundImage:
                "url(https://image.freepik.com/free-photo/beautiful-roses-bouquet-isolated-white-background_23-2147940338.jpg)",
            }}
          >
            <h3>Title</h3>
          </Col>
          <Col
            className="d-flex align-items-center justify-content-center cards-flowers col-offset-md-2"
            style={{
              backgroundImage:
                "url(https://image.freepik.com/free-photo/beautiful-roses-bouquet-isolated-white-background_23-2147940338.jpg)",
            }}
          >
            <h3>Title</h3>
          </Col>
        </Row>
        <h3>Pequeños detalles que alegran tu día</h3>
      </Container>
    </>
  );
}
